actionConfiguration.body:
() => {
  LoadUserAsync.run(resp => {
    const formatedList = resp.map(i => ({
      id: i.id,
      email: i.email,
      name: i.name.split(' ')[0]
    }));
    storeValue('usersList', formatedList);
  });
}

